import actionType from "./actionType";

export const increment =(id) => {
    console.log(id)
    return {
        type: actionType.CART_AMOUNT_INCREAMENT,
        payload:{
            id
        }
    }
}

export const decrement = (id) => {
    return {
        type: actionType.CART_AMOUNT_DECREAMENT,
        payload:{
            id
        }
    }   
}
